{"7": ["Чудесные сережки. Все камушки на месте, всё соотвеовует фото 100%. Очень красивые оттенки. Купила в подарок, думаю понравятся.", "2021-03-16T07:44:09Z", "изумрудный, золотистый", "0", 3, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "18": ["Была наказана брендом «Золото Русских» за невнимательность.\nДочь попросила к 8 марту серьги. Самостоятельно выбрала себе, я сделала заказ. При получении я не обратила внимание на отсутствие глаз у птичек. Во-первых, серьги очень мелкие, а зрение не столь хорошее; во-вторых, демонстрационное фото с сайта я видела только мельком – заказывала дочь. Дома, расстроенная таким \"подарком\" дочь, указала мне на мою оплошность. Хорошо, всякое бывает при транспортировке, хотела вернуть товар по браку и перезаказать, благо до 8 марта время осталось. Но бренд мне отказал в возврате товара по браку. Т.е. сбыли брак невнимательному клиенту – и умыли ручки! Обидно.", "2021-02-24T08:33:00Z", "изумрудный, золотистый", "0", 11, 0, 1, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "21": ["Покупала внучке 8 лет. Понравились. Сразу одела.Но носила пару дней.Волосы у внучки очень длинные и волнистые, серьги сильно путаются в волосах. Сняла. ", "2021-02-15T10:57:11Z", "золотистый", "0", 0, 1, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "22": ["Классные , браоа на подарок подруге!", "2021-02-05T16:54:51Z", "изумрудный, золотистый", "0", 2, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "23": ["Оценка магазину. Сами сережки прелесть. Наклееку наклеели не только на нитку но и на сами сережки в 3 (!) местах, а покрытие тонкое - легко повредить.", "2021-02-03T14:06:47Z", "изумрудный, золотистый", "0", 1, 2, 1, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "24": ["Очень нежные серьги. 100% аналог золотых этого же производителя. Изначально заказывала в золоте. Был отказ. Причина на одной подвеске разворачивалась птичка. В заказанных серьгах серебро с позолотой всё отлично. Покупкой очень довольна. Рекомендую к покупке.", "2021-02-02T18:52:12Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "25": ["Серьги на первый взгляд очень хорошие, НО после нескольких дней сами птички перекрутились назад и теперь цветная часть птички смотрит в шею, а задняя сторона наружу... Назад не получается перекрутить... Пришлось отказаться от них. Очень обидно.\nТакие модели нужно делать двусторонними так как они на длинной цепочке крутятся, как хотят.\nДеньги на ветер... ", "2021-01-31T17:40:19Z", "золотистый", "0", 3, 2, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "27": ["очень красивые", "2021-01-22T23:10:09Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "31": ["Изящные. Девочке-подростку особенно подойдут))", "2021-01-17T13:49:51Z", "изумрудный, золотистый", "0", 0, 1, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "36": ["Серьги просто прелесть- прелестная! Изящные птички на цепочках, очень нежные! ", "2021-01-14T17:09:40Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "37": ["От покупки серёжек пришлось отказаться, на одной из граней кварца жёсткий брак - её просто стесали!", "2021-01-12T18:09:48Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "39": ["Очень классные! Лёгкие, очень довольна покупкой!", "2020-12-08T09:10:59Z", "изумрудный, золотистый", "0", 2, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "41": ["Очень красивые, заказала под платье с птичками на весну-лето. Хотелось бы, конечно, птичек чуть-чуть крупнее. Но, в целом, они хороши! Мои не перекручиваются, как писали некоторые ниже. Пришли немного запутанные, я минуту их аккуратно распутывала. Спасибо за коробочку от производителя, это Вам в плюс! Хочу теперь ещё птичек с зелеными камушками, а потом подвески на браслет)) Вообще, я бы ещё всем девочкам набрала в подарки эти серьги, такие они привлекательные!\n Надеюсь, позолота быстро не слезет(есть печальный опыт с кольцом((). Если облезут, напишу гневный отзыв)", "2021-01-10T13:59:18Z", "золотистый", "0", 6, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "42": ["Серьги очень красивые! Качественно выполнены, изящные.", "2021-01-09T16:56:55Z", "изумрудный, золотистый", "0", 1, 1, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "43": ["Моя прелесть, очень классные и удобные сережки, мои любимчики", "2021-01-09T09:54:11Z", "золотистый", "0", 2, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "44": ["Красивые. Алмазная нарезка на цепочках.", "2021-01-08T17:22:04Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "48": ["Целое, в пакетике и в коробочке", "2021-01-05T10:18:15Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "49": ["Супер, я счастлива )))", "2021-01-04T22:07:48Z", "изумрудный, золотистый", "0", 3, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "50": ["Оооочень крутые серёжки. Смотрятся просто супер 👍", "2021-01-04T17:00:20Z", "золотистый", "0", 0, 1, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "52": ["Жене очень понравились. Покупка Супер!", "2020-12-31T22:05:39Z", "изумрудный, золотистый", "0", 6, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "53": ["Берите, очень классные.", "2020-12-30T21:36:30Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "54": ["Лично мне очень понравились.Жду реакцию внучки,это ей Дед Мороз под елочку положит.", "2020-12-30T18:04:28Z", "изумрудный, золотистый", "0", 5, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "55": ["Серьги замечательные: миниатюрные, легкие. Ношу с удовольствием", "2020-12-29T08:52:29Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "56": ["Серьги просто прекрасные! Выше всех похвал! ", "2020-12-28T21:41:24Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "57": ["Серьги очень понравились!👍качество вопросов не вызывает!", "2020-12-28T19:47:57Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "58": ["Невесомые, очень изящные. Все камни на месте. Не знаю, как поведут себя в носке, но выглядят идеально", "2020-12-28T19:43:57Z", "изумрудный, золотистый", "0", 3, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "59": ["Серьги просто прелесть,купила в подарок,закажу и себе", "2020-12-27T15:24:58Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "60": ["Серьги милые. Давно такие хотела, но оригинал дороговато. Посмотрим как будет носиться", "2020-12-25T17:06:23Z", "золотистый", "0", 2, 4, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "61": ["Очень милые сережки", "2020-12-21T12:09:05Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "62": ["Очень нежные и красивые, всё супер, очень аккуратно упаковано, пришло целое. Буду ещё заказывать у фирмы русское золото.", "2020-12-21T08:44:12Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "63": ["Красивые,но малюсенькие.", "2020-12-20T16:25:51Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "64": ["Давно присматривалась к этим сережкам, купила за 1995 руб.и каково же было мое удивление( негодование!!!), когда на оф. сайте фирмы они стоят в два раза дешевле! Накручивать 200 %, это хамство, знаете ли.. и вернуть их теперь конечно нельзя.Сами серьги красивые, но осадочек теперь....", "2020-12-19T15:58:16Z", "изумрудный, золотистый", "0", 7, 0, 1, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "66": ["Все пришло вовремя. При мне вскрыли пакет, проверяя содержимое. Пришли, хорошего качества, ничего не повреждено", "2020-12-19T19:36:30Z", "изумрудный, золотистый", "0", 3, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "67": ["Серьги