то Русских"], "83": ["Отличный комплект. Очень хорошее качество покрытия золотом. ", "2020-11-23T20:27:56Z", "золотистый", "0", 2, 1, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "86": ["Очень классные серьги, нежные и очень женственно выглядят.", "2020-11-18T15:26:59Z", "золотистый", "0", 5, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "87": ["Серьги нежные, аккуратные, мне очень понравились. Пришли быстро, в срок. Упакованы в маленьком пакетике вместе с наклейкой, пломбой и ярлычком,а сам пакетик в коробочке с логотипом.\nЦепочка гладкая и тонкая, сечением 1.2х0.6 мм, палочка и дужка 0.9 мм в диаметре.\nПозолота ближе к красному золоту, надеюсь она быстро не сотрётся,  стараюсь не мочить серьги. Думаю, на средней и маленькой мочке будут смотреться отлично!", "2020-11-12T11:25:26Z", "изумрудный, золотистый", "0", 8, 2, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "88": ["Серьги классные. как на картинке выглядят очень оригинально, спасибо.", "2020-11-09T17:46:18Z", "изумрудный, золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "90": ["Отличные серёжки, все как на фото, в живую даже лучше 🤗 походят на золотые", "2020-10-25T06:12:40Z", "золотистый", "0", 0, 1, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "92": ["Они шикарны", "2020-10-19T04:57:24Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позолотой и вставкой кварц", "Золото Русских"], "93": ["Серги отличные!легкие,нежные.птички просто замечательные. Всем рекомендую!", "2020-10-17T05:17:34Z", "изумрудный, золотистый", "0", 4, 0, 5, "Серьги-протяжки, серьги-цепочки, серебро 925 пробы, Колибри, с позоло