мню те, но первое впечатление было именно такое: «Ой, какие маленькие». Вряд ли такое было бы к той вещи, которую ранее держал в руках и примерял. Тут вроде как облегчённый, упрощенный вариант, но просто суперские все равно) на ушах не напрягают) лёгкие) ", "2020-05-23T06:46:11.865280718Z", "золотистый", "0", 22, 7, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "181": ["Обожаю этих птичек) Размер оказался прямо, как надо) больше или меньше даже не хочется) Добавлю ещё несколько фото) ", "2020-05-27T21:40:18.522103341Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "182": ["Очень понравились", "2020-05-25T15:17:53.447827565Z", "золотистый", "0", 11, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "183": ["Очень понравились. За такую цену просто супер. Цвет камня немного светлее чем на фото, там прям рубиновый. Он больше розовый, но мне именно это и надо, а зеленые камушки смотрятся поярче. Я очень довольна, и мужу понравились.", "2020-05-25T10:48:22.733868504Z", "золотистый", "0", 4, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "185": ["Интересные, все камни на месте", "2020-05-24T18:58:36.955450876Z", "золотистый", "0", 4, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "186": ["Обалденные сережки😍", "2020-05-23T10:02:02.109011998Z", "золотистый", "0", 2, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "187": ["Чудесные серьги,  аккуратные. Очень нравятся!", "2020-05-21T12:21:05.455214189Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "188": ["Сережки прибыли в фирменной коробочке. Очень лёгкие и красивые, в носке удобные. Ношу не снимая, внешний вид как в первый день покупки.", "2020-05-20T03:25:46.839530743Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "189": ["Такие красивые серьги! Очень милые, без брака или других недочетов! На ушах смотрятся очень нежно. Они отличаются от «оригинальных» (ну вы поняли), но в глаза не бросается. Пришли с милой коробочкой. Рекомендую!", "2020-05-09T11:41:07.365770253Z", "золотистый", "0", 7, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "190": ["Серёжки пришли во время. Серьги были в пакетике, в коробочке. Все в целости и сохранности. Очень красиво смотрятся, птички изумительные. Серёжками я довольна", "2020-05-05T13:07:18.654128051Z", "золотистый", "0", 5, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "192": ["Доставка на дом,  курьер ( девочка)👍 сам товар супер,  все целое и красивое ! Спасибо ✌", "2020-05-02T14:00:21.69701309Z", "золотистый", "0", 24, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "193": ["Классные серги. Довольна покупкой.", "2020-04-30T16:30:58.193450184Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "194": ["Серьги очень красивые, взяла и не пожалела", "2020-04-30T12:33:41.038507104Z", "золотистый", "0", 3, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "196": ["Красивые серьги, нежные. Давно присматривала их у другого известного бренда в золоте, но цена выше соответственно. Ждала с голубым камнем, но заказала с кварцем под родолит. Смотрится в контрасте с зелёными камушками очень красиво. Покупкой довольна, а скидкой тем более.", "2020-04-29T13:46:12.754899861Z", "золотистый", "0", 3, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "197": ["Сережки красивые, без дефектов (пока не заметила по крайней мере). Птички немного не ровно висят, крутятся, но думаю это нормально для такой подвески на длинной цепочке. Жаль нрт других изделий для гарнитура, как в золоте. Браслет был бы очень кстати.", "2020-04-26T16:28:38.050579095Z", "золотистый", "0", 8, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "198": ["Серьги отличные! Очень красивые. Качественная  проработка деталей. Но мне пришли с неправильным вложением! Вложили две серьги на одно ухо. Во всех отзывах покупателей и на фото сайта птички на серьгах смотрят в разные стороны, а мне пришли птички смотрящие в одну сторону. В результате, когда надеваешь серьги, то получается, что на одном ухе птичка смотрит вперед, а на втором назад. Серьги привез курьер безконтактной доставкой, на Wildberries сказали, что надо обратиться к изготовителю напрямую, чтобы произвести замену. Как обратиться к производителю?", "2020-04-19T07:07:15.518442235Z", "золотистый", "0", 17, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "199": ["Пишу обновленный отзыв. Со мной сразу же связались из ИП Русских А. В этот же день выслали взамен новую пару сережек. Совершенно бесплатно! Серьги просто чудо! Очень довольна покупкой. Муж сказал \"Какие прикольные птички\"))) Я очень довольна!!! Спасибо огромное❤❤❤", "2020-04-25T19:37:50.385939443Z", "золотистый", "0", 1, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "200": ["Очень давно хотела себе висячие серьги...но не к чему душа не лежала. Такие морги в первый раз увидела в соколов золотые, но потом нашла эти. Качество на высоте.....ничем не отличаются от золотых! Боялась что будут длинными....но нет оптимальная длина . Очень аккуратные. Я теперь в них влюблена. Спасибо производителю!!!))))", "2020-04-25T17:18:07.307852Z", "золотистый", "0", 6, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "201": ["Присоединяюсь к числу восторженных отзывов. Серёжки 💥💣. Конечно, это позолота и ее нельзя мочить, чтобы вид сохранить. Но ведь не трудно и снять перед душем. Такие же золотые только Соколов стоят больше 10 т.р.", "2020-04-25T13:44:20.937405173Z", "золотистый", "0", 2, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "202": ["Серьги просто шикарные, миниатюрные,  нежные,  я очень довольна покупкой!", "2020-04-23T11:20:37.361132831Z", "золотистый", "0", 2, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "203": ["Ранее писала отзыв,  чтт довольна покупкой,  которую приобрела 2 дня назад,  сегодня решила надеть серьги и заметила одну деталь на правой сережке отсутвуют 2 зеленых камня!", "2020-04-25T11:40:40.014764779Z", "золотистый", "0", 2, 0, 1, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "204": ["Серьги великолепные! Спасибо огромное, брала в подарок дочке, очень понравились.", "2020-04-24T11:50:30.2531952Z", "золотистый", "0", 4, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "205": ["Серёжки очень красивые, нежные. Понравились.", "2020-04-24T07:09:38.917577602Z", "золотистый", "0", 2, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "208": ["Серьги отличные, ничего не перекручивается. Красивые, необычные и не дорогие. Всем советую на лето красиво.", "2020-04-17T14:56:53.967747323Z", "золотистый", "0", 1, 2, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "209": ["Сережки очень красивые!", "2020-04-14T10:10:46.350004784Z", "золотистый", "0", 3, 1, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "210": ["Фото после распаковки 👍", "2020-04-12T11:47:29.992785242Z", "золотистый", "0", 10, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "211": ["Сережки очень хорошие. Не спадают, крепко держатся. Красивые. За пару недель не потемнели. Посмотрим что будет дальше", "2020-04-12T07:29:22.900363973Z", "золотистый", "0", 5, 0, 4, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "212": ["Очень милые, пока ожидала заказ передумала их брать, но как увидела - не могла не взять. Очень довольна. На лето в \"десятку\".", "2020-04-11T12:38:17.274300061Z", "золотистый", "0", 5, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "213": ["Очень симпатичные и дешевле чем Соколов) модель не для ежедневной носки, поэтому в серебре оптимальнее покупка. Птички переворачиваются, но от этого хуже не смотрятся", "2020-04-10T10:53:19.362357722Z", "золотистый", "0", 4, 1, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "214": ["Очень лёгкие и нежные сережки! Камушки все на месте. Визуально от золота не отличается. Упаковано в подарочную коробку. Покупкой довольна.", "2020-04-08T08:36:52.915412433Z", "золотистый", "0", 3, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "215": ["Пребываю в полном восторге от этих Колибри. Смотрятся очень изящно, легко. У подруги такие же от Соколова, мы сравнили, разницы практически нет. Разве что дешевле в шесть раз. Тут кто-то писал, что они переворачиваются. Да, есть немного при движении, но сразу же возвращаются на место, серьги от Соколова крутятся точно также.  Это же законы физики. Лично я считаю, кому надо чтобы не крутились, не покупайте на цепочке. Покупайте на жесткой сцепке. В общем, я всем довольна. Огромное спасибо производителю за такую нежнятину, ну и цену!", "2020-04-08T07:20:17.188952526Z", "золотистый", "0", 14, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "216": ["Вот тоже заказала,уж очень хотела с такими птич4ами,нашла у Соколова золоты5,но там они 10тыс,цена кусалась,а тут за 1500 красота. Но...одно большое но. Женщиа в отзыве уже писала,они переворачиваются постоянно и другой стороной у меня все время были обращены. Ну совсем не смотрятся..думаю,с такой моделью практичнее делать тогда двухстороннюю птичку. Отказ с сожалением", "2020-04-01T15:12:05.462412451Z", "золотистый", "0", 11, 3, 4, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "218": ["Красивые . Похожи на ***, но очень часто переворачиваются. Расстраивает", "2020-04-01T18:45:49.660601204Z", "золотистый", "0", 5, 2, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "219": ["Серьги очень красивые. Заказывала с камнями красного и голубого цвета. Выкупила с красными камнями.", "2020-03-30T13:34:55.998251897Z", "золотистый", "0", 5, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "220": ["Серьги красивые, мне очень понравились. На солнышке красиво блестят. Надеюсь, в носке не подведут.", "2020-03-26T11:48:07.814221657Z", "золотистый", "0", 19, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"], "221": ["Серьги мне понравились, длинные, выглядят как золотые. На весну-лето можно с удовольствием носить. Будут ли темнеть - покажет время, потом добавлю отзыв. ", "2020-03-13T18:59:30.528845962Z", "золотистый", "0", 11, 0, 5, "Серьги-протяжки, серьги-продевки Колибри из серебра 925 пробы с золочением и вставкой кварц", "Золото Русских"]}
